export const WITHDORW_MANY="WITHDORW_MANY"
export const DIPOSED_MONAY="DIPOSED_MONAY"
export const action=(amount)=>{
    return{
        type:WITHDORW_MANY,
        paylod:amount
    }
}
export const action2=(amount)=>{
    return{
        type:DIPOSED_MONAY,
        paylod:amount
    }
}
